import React, { Fragment } from 'react';

class SearchPage extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      searchText : '',
    }

    this.updateSearchText = this.updateSearchText.bind(this);
  }



  searchTextChange = (e) => {
    console.log(e);
    this.setState({searchText: e.target.value});
  }

  render() {
    return (<Fragment>
      <div class="field">
        <div class="control">
          <input class="input is-primary" onChange={this.updateSearchText} type="text" placeholder="Search" />

        </div>

      </div>
      <button class="button">Search</button>
    </Fragment>);
  }
}

export default SearchPage;
